ecc_agent_script_include.script:
// eslint-disable-next-line no-var
var VMwareLoginParams = Class.create();

VMwareLoginParams.prototype = {
  initialize: function () {
    this.Endpoint = probe.getParameter('url');
    this.Identity = probe.getParameter('username');
    this.Credentials = probe.getParameter('password');
  },

  type: 'VMwareLoginParams'
};

VMwareLoginParams.prototype.get = function (name) {
  return this[name];
};
